import { ChangeEvent, FormEvent, Fragment, useState } from 'react';
import iFactura from '../Interfaces/Interfaces';

interface Props {
    addANewFactura: (factura: iFactura) => void;
}

type HandleInputChange = ChangeEvent<HTMLInputElement| HTMLTextAreaElement>;

const AltaFacturas = (prop:Props) => {
    const [factura, setFactura] = useState({
        IDComision: 0, 
    NombrePrestador: "", 
    CuitPrestador: "",  
    NroPrestador: "",  
    TipoFactura: "", 
    ImporteFacturado: 0, 
    NroFactura: ""
    });


    const handlerNewFactura = (e:FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        prop.addANewFactura(factura);
    }

    const handleInputChange = ({
        target : { name, value },
    }:HandleInputChange) => {
        setFactura({
            ...factura,
            [name]: value,
        });
    }

    return(
        <Fragment>
            <form onSubmit={handlerNewFactura}>
                <label>IdComision</label>
                <input type="number" onChange={handleInputChange} value={factura.IDComision}></input>
                <label>NombrePrestador</label>
                <input type="text" onChange={handleInputChange} value={factura.NombrePrestador}></input>
                <label>CuitPrestador</label>
                <input type="text" onChange={handleInputChange} value={factura.CuitPrestador}></input>
                <label>NroPrestador</label>
                <input type="text" onChange={handleInputChange} value={factura.NroPrestador}></input>
                <label>TipoFactura</label>
                <input type="text" onChange={handleInputChange} value={factura.TipoFactura}></input>
                <label>ImporteFacturado</label>
                <input type="number" onChange={handleInputChange} value={factura.ImporteFacturado}></input>
                <label>NroFactura</label>
                <input type="text" onChange={handleInputChange} value={factura.NroFactura}></input>
                <button >Agregar</button>
            </form>
        </Fragment>
    )

}


export default AltaFacturas;
